import React, { useState } from 'react';
import Todo from './todo'


const Navbar = () => {

  return (
    <div class="min-h-screen w-screen bg-gray-100">
         <div class="h-16 bg-gray-700 font-bold text-xl tracking-widest text-white p-5  font-robo">Todo App</div>
         <Todo/>
    </div>        
     
     
  );


};


export default Navbar;
